void Bucket_1_ac_long(long *A, size_t LEN){
    long N = LEN ;
    long Z[256][N+1] ;
    int bits = 0 ;
    long indx ;
    long LSB ;
    long i ;
    long bucket ;
    while(bits < 25)
    {
        indx = 0 ;
        while(indx < 256)
        {
            Z[indx][0] = 0 ;
            ++indx ;
        }
        indx = 0 ;
        while(indx < N)
        {
            LSB = ( A[indx] >> bits ) & 255 ;
            Z[LSB][++Z[LSB][0]] = A[indx] ;
            ++indx ;
        }
        if( Z[LSB][0] == N );
        else
        {
            i = 0 ;
            bucket = 0 ;
            while(bucket < 256)
            {
                indx = 1 ;
                while(indx <= Z[bucket][0])
                {
                    A[i] = Z[bucket][indx] ;
                    ++i ;
                    ++indx ;
                }
                ++bucket ;
            }
        }
        bits += 8 ;
    }
}
